const Form = () => {
    return(
        <form>
            <input type='text' placeholder='Firstname'></input>
            <input type='text' placeholder='Lastname'></input>
            <input type='number' placeholder='Age'></input>
            <input type='submit' placeholder='Submit'></input>
            
        </form>
    )
}

export default Form
